import "../../Styles/transaction.css";
import React from "react";

const ChooseTransactionTypeComponent = props => {
    const onChange = e => {
        console.log('click')
    }
    return (
        <>
        <h4>choose transaction type</h4>
        <div id="choose-transaction" className="X column-gap-2-px blackground">
            <div id="transaction" class="X X-flex-1 X-jc-center X-ai-center transition-ease whiteground"
            onClick={(e)=>onChange(e)}
            >
                <h5>transaction</h5>
            </div>
            <div id="fee-bump" class="X X-flex-1 X-jc-center X-ai-center transition-ease whiteground">
                <h5>fee bump</h5>
            </div>
        </div>
        </>
    )
}
export default ChooseTransactionTypeComponent;
